import styled from "styled-components";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 100%;
`;
const Title = styled.div`
  width: 100%;
  height: 120px;
  text-align: center;
  line-height: 120px;
  font-size: 50px;
  margin-top: 50px;
`;
const Contents = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
  margin-top: 50px;
  height: 600px;
`;
const Logo = styled.div`
  width: 400px;
  height: 400px;
`;
const Aside = styled.div`
  margin-left: 50px;
  height: 500px;
  width: 740px;
`;
const Top = styled.div`
  height: 100px;
  margin-top: 20px;
  line-height: 40px;
  font-size: 30px;
  font-weight: bold;
`;
const Middle = styled.div`
  height: 130px;
  line-height: 26px;
  span {
    font-size: 20px;
  }
`;
const Bottom = styled.div`
  height: 130px;
  margin-top: 30px;
  line-height: 40px;
  p {
    font-size: 20px;
    line-height: 30px;
    height: 30px;
  }
  h5 {
    font-weight: 200;
    text-indent: 8px;
  }
  span {
    font-size: 20px;
    line-height: 30px;
  }
`;

export function Intro() {
  return (
    <>
      <Container>
        <Logo>
          <a href="#">
            <img src="/logo/" width="400" height="400" alt="untitled_logo" />
          </a>
        </Logo>
        <h1>
          Hello, <span>UNTITLED</span>
        </h1>
      </Container>
    </>
  );
}
